import styled from 'styled-components';

export const Wrapper = styled.div`

 nav {
    padding: 3px 16px;
    background-color: #292c2f;
 }

.navbar-brand{
 font-family: "Trebuchet MS", sans-serif;
 letter-spacing: -1px;
 font-size: 45px;
 margin-left: 50px;
 margin-bottom: -10px;
 margin-top: -5px;
 color: white;
}

p { 
color: white;
}
`;
